// ContenedorPadre.js

import React from 'react';
import ContenedorHijo from './ContenedorHijo';

function ContenedorPadre() {
  return (
    <div className="contenedor-padre">
      <ContenedorHijo /> {/* Renderiza el contenedor hijo dentro del contenedor padre */}
    </div>
  );
}

